define({
    inputs: {
        monthUp: "boolean",
        monthDown: "boolean",
        startMonthIndex: "number",
    },
    outputs: {
        month: "string",
        monthIndex: "number",
    },
    setup: function(inputs, outputs) {
        this.monthIndex = 0;
        outputs.monthIndex = this.monthIndex+1;
        outputs.month = 'January';
    },
    run: function(inputs, outputs) {
        var months = ['January','February','March','April','May','June','July','August','September','October','November','December'];

        if(this._startMonthIndex !== inputs.startMonthIndex) {
            this._startMonthIndex = inputs.startMonthIndex;
            this.monthIndex = inputs.startMonthIndex;
        }        

        if(inputs.monthUp) {
            this.monthIndex++;
            if(this.monthIndex > 11) this.monthIndex = 0;
        }
        if(inputs.monthDown) {
            this.monthIndex--;
            if(this.monthIndex < 0) this.monthIndex = 11;
        }

        outputs.month = months[this.monthIndex];    
        outputs.monthIndex = this.monthIndex+1;        
    }
});

define({
    inputs: {
        monthIndex: "number",
        year: "string",
        dateUp: "boolean",
        dateDown: "boolean",
        startDate: "number"
    },
    outputs: {
        date: "number",
        formattedDate: "string"
    },
    setup: function(inputs, outputs) {
        this.date = 1;
        outputs.date = this.date;
    },
    run: function(inputs, outputs) {
         if(this._startDate !== inputs.startDate) {
            this._startDate = inputs.startDate;
            this.date = inputs.startDate;
        }       

        // Clamp date
        var date = new Date(inputs.year + '-' + (inputs.monthIndex>=10?inputs.monthIndex:('0'+inputs.monthIndex)) + '-01');
        var lastDay = (new Date(date.getFullYear(), date.getMonth() + 1, 0)).getDate();
        if(this.date > lastDay) {
            this.date = lastDay;
        }

        if(inputs.dateUp) {
            this.date++;
            if(this.date > lastDay) this.date = 1;
            outputs.date = this.date;
        }
        if(inputs.dateDown) {
            this.date--;
            if(this.date < 1) this.date = lastDay;
        }        

        outputs.date = this.date;

        var formattedDate = inputs.year + '-' + (inputs.monthIndex>=10?inputs.monthIndex:('0'+inputs.monthIndex)) + '-' + (this.date>=10?this.date:('0' + this.date));
        outputs.formattedDate = formattedDate;
    }
});

